import React from "react";
import { v4 as uuidv4 } from "uuid";

export default function ListPosts({ posts }) {
  const errorHandling =
    typeof posts === "string" ? "Error" : <ul>list()</ul>;

  const returnList = () => {
    errorHandling;
  };

  const list = () =>
    posts.map(({ title }) => <li key={uuidv4()}>{title}</li>);

  return <ul>{returnList()}</ul>;
}
